import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart is empty
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      throw new Error('Cart is empty - cannot update quantity');
    }

    // Get initial quantity of first cart item
    const initialQuantity = await page.$eval('.cart-item .quantity', el => parseInt(el.textContent));

    // Increase quantity by clicking the plus button
    await page.waitForSelector('.cart-item .quantity-btn:nth-child(3)', { timeout: 5000 });
    await page.click('.cart-item .quantity-btn:nth-child(3)');

    // Wait for quantity to update
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = parseInt(document.querySelector('.cart-item .quantity').textContent);
        return currentQty === initialQty + 1;
      },
      { timeout: 5000 },
      initialQuantity
    );

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Get updated quantity
    const updatedQuantity = await page.$eval('.cart-item .quantity', el => parseInt(el.textContent));

    // Get product name for verification
    const productName = await page.$eval('.cart-item-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Updated cart item quantity from " + initialQuantity + " to " + updatedQuantity,
      extractedData: {
        product: productName,
        initialQuantity: initialQuantity,
        updatedQuantity: updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
